import React from 'react';
import Chatbot from './Chatbot';
import { useState } from 'react';
import ShowResult from './ShowResult';
import ShowResult01 from './ShowResult01';
import ShowResult02 from './ShowResult02';
import "./Home.css"
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Accordion from 'react-bootstrap/Accordion';
export default function Home() {
  const [showResultContent, setShowResultContent] = useState(false);
  const [showResultContent01,setShowResultContent01] = useState(false);
  const [showResultContent02,setShowResultContent02] = useState(false);
  const handleClick01 = () => {
    setShowResultContent(true);
  };
  const handleClick02 = () => {
    setShowResultContent01(true);
  };
  const handleClick03 = () => {
    setShowResultContent02(true);
  };
  return (
    <>
      <nav className="navbar navbar-light " style={{backgroundColor:"#167ac6"}}>
        <img src="https://mrcet.com/images/logo_mallareddy.png" style={{height:"fit-content"}}/>
        <img src="https://mrcet.com/images/logo_121.png" />
        <nav className="navbar navbar-light" style={{backgroundColor:"#167ac6"}}>
        <h4><i className="fa-regular fa-user" id ="tab"></i><br></br></h4>
        <h4>Welcome Admin</h4>
        </nav>
      </nav>
      <Navbar expand="lg" className="bg-body-tertiary">
      <Container>
        <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#link">Link</Nav.Link>
            <NavDropdown title="Dropdown" id="basic-nav-dropdown">
              <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">
                Another action
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.4">
                Separated link
              </NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
      <nav className="navbar navbar-light bg-warning">
        <marquee>
          <h3 className="navbar-brand mb-0 h1">Highest Package AC.Yr 2024:  20N31A66G2(31 LPA),20N31A66Y0(31 LPA) -- OpenAI</h3>
        </marquee>
      </nav><br></br><br></br>
      <div className="main-content text-center">
        <div className="button-container text-center">
        <Accordion className="Acco">
          <Accordion.Item eventKey="0" style={{backgroundColor:"blue"}}>
          <Accordion.Header style={{textAlign:"center"}}>Test Information</Accordion.Header>
          <Accordion.Body>
          <button onClick={handleClick01} className="btn btn-primary">Written Test Results</button>
          {showResultContent && <ShowResult />}<br></br><br></br> 
          </Accordion.Body>
          </Accordion.Item>
          <Accordion.Item eventKey="1">
          <Accordion.Header>Company Information</Accordion.Header>
          <Accordion.Body>
          <button className="btn btn-success" onClick={handleClick02}>Companies Active</button><br></br><br></br>
          {showResultContent01 && <ShowResult01/>}<br></br><br></br>
          </Accordion.Body>
          </Accordion.Item>
          <Accordion.Item eventKey="2">
          <Accordion.Header>Placement Schedules</Accordion.Header>
          <Accordion.Body>
          <button className="btn btn-info" onClick={handleClick03}>Schedule</button>
          {showResultContent02 && <ShowResult02/>}<br></br><br></br>
          </Accordion.Body>
          </Accordion.Item>
          </Accordion>
          <br></br><br></br>
        </div>
      </div>
      <Chatbot/>
    </>
  );
}
